import { NextApiRequest, NextApiResponse } from 'next'
import ReactDOMServer from 'react-dom/server';

import Home from '..'
import React from 'react'
// API Routes Details

// https://nextjs.org/learn/basics/api-routes/api-routes-details
const list = (req: NextApiRequest, res: NextApiResponse) => {
  const HTMLString :string = ReactDOMServer.renderToString(<Home/>);
  console.log(HTMLString.toString());
  
  res.status(200).send(HTMLString.toString())
  // res.status(200).json({ 'msg':'Welcome to our endpoint' })
  // res.status(404).json({ 'error': 'something went wrong' })
}

export default list
